import React from 'react';

function DietOverweight1() {
  return (
    <div className="diet-page">
      <h1>Diet for Overweight Level 1</h1>
      <p>For Overweight Level 1, it is important to focus on a balanced diet that includes:</p>
      <ul>
        <li>High fiber vegetables and fruits.</li>
        <li>Lean proteins such as chicken or fish.</li>
        <li>Whole grains like brown rice and whole wheat bread.</li>
        <li>Low-fat dairy products.</li>
        <li>Limiting sugary drinks and snacks.</li>
      </ul>
      <p>Regular physical activity should also be included in your routine.</p>
    </div>
  );
}

export default DietOverweight1;
